    "2016-05-27T02:32:48.991952",nt"name": "hydraulic-structures",nt"isopen":
    false,nt"url": null,nt"notes": "This table is required whenever hydraulic
    structures are shown in the flood profile. It is also required if levees are shown
    on the FIRM, channels containing the flooding are shown on the FIRM, or any other
    structure that impacts the area_s flood risk is shown on the FIRM. The S_Gen_Struct
    table contains information about the hydraulic structures within the study area.
    It should include all structures shown in the flood profiles. In addition, levees,
    sea walls, channels that contain flooding, and other significant flood control structures
    shown on the Flood Insurance Rate Map (FIRM) should be included. A spatial file
    with locational information also corresponds with this data table. Spatial elements
    representing general structures are represented by lines. The lines should represent
    the primary characteristic of the structure. For example, bridges should be represented
    by the transportation centerline carried by the bridge. Dams should be represented
    by a line corresponding to the top of the dam. Levees should be represented by a
    line corresponding to the top of levee. A line corresponding to the centerline of
    the main barrel should represent a culvert. This is a Standard DFIRM Database table.
    More information can be found in the document 'Guidelines and Specifications for
    Flood Hazard Mapping Partners Appendix LGuidance for Preparing Draft Digital Data
    and DFIRM Database' located on this disk.",nt"license_title": "License Not
